import React from "react";
import {LINKS_NAV, PATH_LOGIN, PATH_LOGOUT} from "../config/config_nav";
import {NavLink} from "react-router-dom";
import {LINKS_GENERAL_MENU} from "../config/config_products";

const Products = () => {
    const itemNavigation = LINKS_GENERAL_MENU.map(link => {
        return <NavLink key={link.path} className="menu__link" to={link.path}>{link.label}</NavLink>
    })
    return <React.Fragment>
        <div className="content">
            <div className="container">
                <div className="content__header">
                    <div className="content__header-strip">
                        <div/>
                    </div>
                    <span className="content__header-title">PRODUCTS</span>
                </div>
                <nav className="nav">
                    {itemNavigation}
                </nav>
                <div className="content__body">
                    <div className="content__body-products">
                        <div className="product__item">
                            {/*<div className="card" style="width: 18rem;">*/}
                            {/*    <img src="..." className="card-img-top" alt="..."/>*/}
                            {/*    <div className="card-body">*/}
                            {/*        <h5 className="card-title">Название карточки</h5>*/}
                            {/*        <p className="card-text">Some quick example text to build on the card title and make*/}
                            {/*            up the bulk of the card's content.</p>*/}
                            {/*        <a href="#" className="btn btn-primary">Go somewhere</a>*/}
                            {/*    </div>*/}
                            {/*</div>*/}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </React.Fragment>
}

export default Products;
